import React from 'react'


function Registration() {
    return (
      <div className='mainwin'>
      <h1>Регистрация</h1>
      <input placeholder='Почта'/>
      <div>Зарегестрирован? Войди в акаунт!</div>
      <a href='/login'>Вход</a>
      </div>
    )
}

export default Registration
